import React, { Component } from "react";

class Signup extends Component{
    render(){
        return(
            <div>
                <form onSubmit={this.props.handleSubmit}>
                    <input name={'first_name'} onChange={this.props.handleChange} placeholder="First Name"/>
                    <input name={'last_name'} onChange={this.props.handleChange} placeholder="Last Name"/>
                    <input name={'last_name'} onChange={this.props.handleChange} placeholder="Last Name"/>
                </form>
            </div>
        )
    }
}

export default Signup
